import React from 'react';
import { Link } from 'react-router-dom'; // Importe o Link para a navegação interna do React Router

const TopBar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
        <Link className="navbar-brand" to="/">Sua Empresa</Link> {/* Use Link em vez de <a> para navegação interna */}
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav me-auto"> {/* Adicione a classe me-auto para alinhar à esquerda */}
            <li className="nav-item">
              <Link className="nav-link" to="/voltar">Voltar</Link> {/* Link para a página de voltar */}
            </li>
          </ul>
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link" to="/">Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/">Sobre</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/">Contato</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default TopBar;
